syntax = "proto3";
package org.minigamzreborn.bytelyplay.protobuffer.packets;

import "packets/HandShakePacketC2S.proto";
import "packets/RegisterServerPacketC2S.proto";

message WrappedPacketC2S {
  oneof body {
    HandShakePacketC2S handShake = 1;
    RegisterServerPacketC2S registerServerPacket = 2;
  }
}